import React, { useState, useEffect } from 'react';
import { FaCar, FaPlus, FaEdit, FaTrash, FaSearch, FaTimes } from 'react-icons/fa';
import { adminApi } from '../../services/api';
import '../../assets/styles/AdminDashboard.css';

const AdminDashboard = () => {
  const [veiculos, setVeiculos] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [showAddModal, setShowAddModal] = useState(false);
  const [showEditModal, setShowEditModal] = useState(false);
  const [selectedVeiculo, setSelectedVeiculo] = useState(null);
  const [formData, setFormData] = useState({
    marca: '',
    modelo: '',
    ano: '',
    preco: '',
    combustivel: '',
    quilometragem: '',
    cor: '',
    descricao: '',
    imagens: [],
    estoque: ''
  });
  const [searchTerm, setSearchTerm] = useState('');

  useEffect(() => {
    carregarVeiculos();
  }, []);

  const carregarVeiculos = async () => {
    try {
      setLoading(true);
      const response = await adminApi.listarVeiculos();
      setVeiculos(response.data.veiculos);
      setError(null);
    } catch (err) {
      setError('Erro ao carregar veículos');
      console.error('Erro:', err);
    } finally {
      setLoading(false);
    }
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleImageUpload = (e) => {
    const files = Array.from(e.target.files);
    const imagePromises = files.map(file => {
      return new Promise((resolve) => {
        const reader = new FileReader();
        reader.onloadend = () => {
          resolve(reader.result);
        };
        reader.readAsDataURL(file);
      });
    });

    Promise.all(imagePromises).then(images => {
      setFormData(prev => ({
        ...prev,
        imagens: [...prev.imagens, ...images]
      }));
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      if (showEditModal) {
        await adminApi.atualizarVeiculo(selectedVeiculo.id, formData);
      } else {
        await adminApi.adicionarVeiculo(formData);
      }
      setShowAddModal(false);
      setShowEditModal(false);
      setFormData({
        marca: '',
        modelo: '',
        ano: '',
        preco: '',
        combustivel: '',
        quilometragem: '',
        cor: '',
        descricao: '',
        imagens: [],
        estoque: ''
      });
      carregarVeiculos();
    } catch (err) {
      setError('Erro ao salvar veículo');
      console.error('Erro:', err);
    }
  };

  const handleEdit = (veiculo) => {
    setSelectedVeiculo(veiculo);
    setFormData({
      marca: veiculo.marca,
      modelo: veiculo.modelo,
      ano: veiculo.ano,
      preco: veiculo.preco,
      combustivel: veiculo.combustivel,
      quilometragem: veiculo.quilometragem,
      cor: veiculo.cor,
      descricao: veiculo.descricao,
      imagens: veiculo.imagens || [],
      estoque: veiculo.estoque
    });
    setShowEditModal(true);
  };

  const handleDelete = async (id) => {
    if (window.confirm('Tem certeza que deseja excluir este veículo?')) {
      try {
        await adminApi.deletarVeiculo(id);
        carregarVeiculos();
      } catch (err) {
        setError('Erro ao deletar veículo');
        console.error('Erro:', err);
      }
    }
  };

  const filteredVeiculos = veiculos.filter(veiculo =>
    veiculo.marca.toLowerCase().includes(searchTerm.toLowerCase()) ||
    veiculo.modelo.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className="admin-dashboard">
      <div className="admin-header">
        <h1>Painel Administrativo</h1>
        <div className="admin-actions">
          <div className="admin-search-bar">
            <FaSearch className="admin-search-icon" />
            <input
              type="text"
              placeholder="Buscar veículos..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
            />
          </div>
          <button className="admin-btn-primary" onClick={() => setShowAddModal(true)}>
            <FaPlus /> Adicionar Veículo
          </button>
        </div>
      </div>

      {error && <div className="admin-error-message">{error}</div>}

      {loading ? (
        <div className="admin-loading">Carregando...</div>
      ) : (
        <div className="admin-veiculos-grid">
          {filteredVeiculos.map(veiculo => (
            <div key={veiculo.id} className="admin-veiculo-card">
              <div className="admin-veiculo-image">
                {veiculo.imagens && veiculo.imagens.length > 0 ? (
                  <img src={veiculo.imagens[0]} alt={`${veiculo.marca} ${veiculo.modelo}`} />
                ) : (
                  <FaCar className="admin-placeholder-icon" />
                )}
              </div>
              <div className="admin-veiculo-info">
                <h3>{veiculo.marca} {veiculo.modelo}</h3>
                <p>Ano: {veiculo.ano}</p>
                <p>Preço: R$ {veiculo.preco}</p>
                <p>Estoque: {veiculo.estoque}</p>
              </div>
              <div className="admin-veiculo-actions">
                <button className="admin-btn-edit" onClick={() => handleEdit(veiculo)}>
                  <FaEdit />
                </button>
                <button className="admin-btn-delete" onClick={() => handleDelete(veiculo.id)}>
                  <FaTrash />
                </button>
              </div>
            </div>
          ))}
        </div>
      )}

      {/* Modal de Adicionar/Editar Veículo */}
      {(showAddModal || showEditModal) && (
        <div className="admin-modal">
          <div className="admin-modal-content">
            <div className="admin-modal-header">
              <h2>{showEditModal ? 'Editar Veículo' : 'Adicionar Veículo'}</h2>
              <button className="admin-close-button" onClick={() => {
                setShowAddModal(false);
                setShowEditModal(false);
              }}>
                <FaTimes />
              </button>
            </div>
            <form onSubmit={handleSubmit}>
              <div className="admin-form-group">
                <label>Marca:</label>
                <input
                  type="text"
                  name="marca"
                  value={formData.marca}
                  onChange={handleInputChange}
                  required
                />
              </div>
              <div className="admin-form-group">
                <label>Modelo:</label>
                <input
                  type="text"
                  name="modelo"
                  value={formData.modelo}
                  onChange={handleInputChange}
                  required
                />
              </div>
              <div className="admin-form-group">
                <label>Ano:</label>
                <input
                  type="number"
                  name="ano"
                  value={formData.ano}
                  onChange={handleInputChange}
                  required
                />
              </div>
              <div className="admin-form-group">
                <label>Preço:</label>
                <input
                  type="number"
                  name="preco"
                  value={formData.preco}
                  onChange={handleInputChange}
                  required
                />
              </div>
              <div className="admin-form-group">
                <label>Combustível:</label>
                <input
                  type="text"
                  name="combustivel"
                  value={formData.combustivel}
                  onChange={handleInputChange}
                  required
                />
              </div>
              <div className="admin-form-group">
                <label>Quilometragem:</label>
                <input
                  type="number"
                  name="quilometragem"
                  value={formData.quilometragem}
                  onChange={handleInputChange}
                  required
                />
              </div>
              <div className="admin-form-group">
                <label>Cor:</label>
                <input
                  type="text"
                  name="cor"
                  value={formData.cor}
                  onChange={handleInputChange}
                  required
                />
              </div>
              <div className="admin-form-group">
                <label>Descrição:</label>
                <textarea
                  name="descricao"
                  value={formData.descricao}
                  onChange={handleInputChange}
                  required
                />
              </div>
              <div className="admin-form-group">
                <label>Estoque:</label>
                <input
                  type="number"
                  name="estoque"
                  value={formData.estoque}
                  onChange={handleInputChange}
                  required
                />
              </div>
              <div className="admin-form-group">
                <label>Imagens:</label>
                <input
                  type="file"
                  multiple
                  accept="image/*"
                  onChange={handleImageUpload}
                />
                <div className="admin-image-preview">
                  {formData.imagens.map((img, index) => (
                    <img key={index} src={img} alt={`Preview ${index + 1}`} />
                  ))}
                </div>
              </div>
              <div className="admin-form-actions">
                <button type="submit" className="admin-btn-primary">
                  {showEditModal ? 'Salvar Alterações' : 'Adicionar Veículo'}
                </button>
              </div>
            </form>
          </div>
        </div>
      )}
    </div>
  );
};

export default AdminDashboard;
